/*==============================================================*/
/* Table: JUGADOR                                               */
/*==============================================================*/
create table JUGADOR 
(
   ID_JUGADOR            integer                        not null GENERATED ALWAYS AS IDENTITY (START WITH 1, INCREMENT BY 1),
   estaActivo            varchar(5)                     , 
   NOMBRE_JUGADOR        varchar(50)                    not null UNIQUE,
   ID_PERSONAJE          integer                        UNIQUE,
   ID_MJ_AMIGO           integer                        UNIQUE,
   ID_ROLJUGADOR         smallint                       not null,
   CONTRASENIA_JUGADOR   varchar(50)                    not null,
   ID_CARRERA            smallint                       not null,
   DINEROJGDR            integer                        not null
);

CREATE TABLE PERSONAJES (
        id INTEGER not null PRIMARY KEY
             GENERATED ALWAYS AS IDENTITY
             (START WITH 1, INCREMENT BY 1),
        nick varchar(30) not null,
        tipo varchar(10) not null,
        rol varchar(10),
        vida INTEGER not null,
        defensa INTEGER not null,
        ataque INTEGER not null,
        movimiento INTEGER not null,
        velocidad INTEGER not null,
        magia INTEGER not null,
        nivelTraicion INTEGER not null,
        imagen varchar(70) not null,
        icono varchar(70) not null,
        imgTablero varchar (70) not null,
        gif varchar(70) not null,
        posicionX INTEGER DEFAULT 0,
        posicionY INTEGER DEFAULT 0,
        posicionZ INTEGER DEFAULT 0,
        id_arma1 INTEGER DEFAULT 0,
        id_arma2 INTEGER DEFAULT 0,
        id_casco INTEGER DEFAULT 0,
        id_pechera INTEGER DEFAULT 0,
        id_pantalon INTEGER DEFAULT 0,
        id_botas INTEGER DEFAULT 0,
        extra1 INTEGER DEFAULT 0,
        extra2 INTEGER DEFAULT 0,
        extra3 INTEGER DEFAULT 0,
        nivel INTEGER DEFAULT 1,
        experiencia INTEGER DEFAULT 0
);

CREATE TABLE FOROGRIEGO(
    ID_JUGADOR INTEGER not null,
    IDPJ        INTEGER not null,
    CANTBATLL  INTEGER not null
);

CREATE TABLE INVENTARIO(
    ID_PERSONAJE INTEGER not null,
    ID_ITEM      INTEGER not null
);

CREATE TABLE AVANCE(
    ID_USUARIO   INTEGER not null,
    ID_RAMO      INTEGER not null,
    ID_CARRERA   INTEGER not null
);





CREATE TABLE ITEMS (
    id_item INTEGER primary key GENERATED ALWAYS AS IDENTITY (START WITH 1, INCREMENT BY 1),
    nom_item varchar(40) not null,
    imagen varchar(50) not null,
    descripcion varchar(100) not null,
    boost INTEGER not null,
    a_boost INTEGER not null,
    tipo varchar(30) not null,
    precio INTEGER not null
);

CREATE TABLE RELMEJORAS(
    id_item INTEGER not null,
    id_mejora INTEGER not null
);

